    public int maximalRectangle(char[][] matrix) {
        Stack<Integer>[] stacks = new Stack[matrix[0].length];
        for (int i = 0; i < matrix[0].length; i++) {
            stacks[i] = new Stack<>();
        }
        int res = 0;
        for (int i = 0; i < matrix.length; i++) {
            for (int j = 0; j < matrix[0].length; j++) {
                Stack<Integer> stack = stacks[j];
                int cell = matrix[i][j] - 48;
                if (stack.isEmpty()) {
                    stack.push(cell);
                    continue;
                }
                if (cell == 0) {
                    stack.pop();
                    stack.push(0);
                    continue;
                }
                stack.push(stack.pop() + 1);
            }
            Stack<Integer> indexes = new Stack<>(), heights = new Stack<>();
            int s = 0, lastZero = -1;
            for (int j = 0; j < matrix[0].length; j++) {
                int cell = stacks[j].peek();
                if (cell == 0 && j != matrix[0].length - 1) {
                    while (!indexes.isEmpty()) {
                        int s1 = (j - indexes.pop()) * heights.pop();
                        if (s < s1) s = s1;
                    }
                    lastZero = j;
                    continue;
                }
                if (indexes.isEmpty()) {
                    indexes.push(j);
                    heights.push(cell);
                    s = Math.max(s, cell);
                    continue;
                }
                int h = heights.peek();
                if (cell == h) {
                    int s1 = (j - indexes.peek() + 1) * cell;
                    if (s < s1) s = s1;
                    continue;
                }
                if (cell > h) {
                    s = Math.max(s, cell);
                    int s1 = (j - indexes.peek() + 1) * h;
                    if (s < s1) s = s1;
                    indexes.push(j);
                    heights.push(cell);
                    continue;
                }
                int lastIndex = 0;
                while (!heights.isEmpty() && heights.peek() > 0 && cell < heights.peek()) {
                    lastIndex = indexes.pop();
                    int s1 = (j - lastIndex) * heights.pop();
                    if (s < s1) s = s1;
                }
                if (indexes.isEmpty()) {
                    indexes.push(lastZero + 1);
                    heights.push(cell);
                } else {
                    if (heights.peek() != cell) {
                        indexes.push(lastIndex);
                        heights.push(cell);
                    }
                }
            }
            while (!indexes.isEmpty()) {
                int s1 = (matrix[0].length - indexes.pop()) * heights.pop();
                if (s < s1) s = s1;
            }
            if (res < s) res = s;
        }
        return res;
    }
